Border Wars Season 2

Technology Documentary hosted by Rodd Housten, published by National Geographic in 2010 - English narration


Information
------------------------------

Border Wars Season 2
The officers and agents of the U.S. Customs and Border Protection (CBP) scour the inhospitable landscape at one of the busiest border crossings in the country, seeking to intercept illegal entrants from the air, on the ground, and at the port of entry. Every day thousands of men, women and children attempt to enter the United States illegally -- some looking for work, some seeking a new life and others trying to smuggle drugs or other contraband. Many will do whatever it takes, often risking their lives by crossing Arizona's treacherous Sonoran Desert. Now, follow the officers and agents who struggle every day to defend this border.



11)  Gang Task Force 
In this episode of Border Wars, Miami and Puerto Rico, agents and officers with the Department of Homeland Security and the Drug Enforcement Administration intercept a boat with a multi-million dollar drug load, apprehend an alleged member of a transnational gang, and destroy a marijuana grow house. Immigration and Customs Enforcement (ICE) agents from a violent gang task force apprehend an alleged member of a dangerous gang to see if he will give them valuable inside information. Hours later, a DEA agent leads a raid on a marijuana grow house operation in West Palm Beach. At the same time, off the coast of Puerto Rico, the U.S. Coast Guard intercepts a fishing boat carrying what turns out to be more than 500 pounds of cocaine



